// HasPrices applies the HasEdge predicate on the "prices" edge.
func HasPrices() predicate.CustomPricingUnit {
	return predicate.CustomPricingUnit(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, PricesTable, PricesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasPricesWith applies the HasEdge predicate on the "prices" edge with a given conditions (other predicates).
func HasPricesWith(preds ...predicate.Price) predicate.CustomPricingUnit {
	return predicate.CustomPricingUnit(func(s *sql.Selector) {
		step := newPricesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CustomPricingUnit) predicate.CustomPricingUnit {
	return predicate.CustomPricingUnit(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CustomPricingUnit) predicate.CustomPricingUnit {
	return predicate.CustomPricingUnit(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CustomPricingUnit) predicate.CustomPricingUnit {
	return predicate.CustomPricingUnit(sql.NotPredicates(p))
}
